import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element to be visible and click on it
    await page.waitForSelector('.cart');
    await page.click('.cart');

    // Wait for the cart items to load
    await page.waitForSelector('.cart-item');

    // Take screenshot of the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Click the remove button for the first item in the cart
    await page.click('.remove-item');

    // Wait for the cart to update
    await page.waitForTimeout(1000); // Adjust timeout as necessary

    // Take screenshot after removing the item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Verify the item has been removed
    const cartItems = await page.$$('.cart-item');
    const itemRemoved = cartItems.length === 0; // Assuming the item is removed if no items are left

    return {
      success: true,
      action: "Removed item from cart",
      extractedData: { itemRemoved },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
